        var roadLayer = null;
        var routeLayers = [];
        var currentTrip = null;

        function toggleRoads() {
            if (document.getElementById('showRoads').checked) {
                if (!roadLayer) {
                    var lines = roads.map(r => L.polyline([[r.coords[0][1], r.coords[0][0]], [r.coords[1][1], r.coords[1][0]]], {color: '#bdc3c7', weight: 1, opacity: 0.5}));
                    roadLayer = L.layerGroup(lines);
                }
                roadLayer.addTo(map);
            } else {
                if (roadLayer) map.removeLayer(roadLayer);
            }
        }

        function clearRoutes() {
            routeLayers.forEach(l => map.removeLayer(l));
            routeLayers = [];
        }

        function updateView() {
            if (currentTrip !== null) loadTrip(currentTrip);
        }

        function loadTrip(idx) {
            clearRoutes();
            currentTrip = idx;
            var trip = trips[idx];
            var bounds = [];
            
            // GPS track
            if (document.getElementById('showGps').checked && trip.gps.length > 0) {
                var gpsLL = trip.gps.map(c => [c[1], c[0]]);
                var gpsLine = L.polyline(gpsLL, {color: '#e74c3c', weight: 3, opacity: 0.8, dashArray: '5,5'});
                routeLayers.push(gpsLine);
                gpsLine.addTo(map);
                bounds = bounds.concat(gpsLL);
                
                // GPS points
                trip.gps.forEach((c, i) => {
                    var m = L.circleMarker([c[1], c[0]], {radius: 3, color: '#e74c3c', fillOpacity: 0.6});
                    routeLayers.push(m);
                    m.addTo(map);
                });
            }
            
            // Matched route
            if (document.getElementById('showMatched').checked && trip.matched.length > 0) {
                var matchLL = trip.matched.map(c => [c[1], c[0]]);
                var matchLine = L.polyline(matchLL, {color: '#3498db', weight: 4, opacity: 0.9});
                routeLayers.push(matchLine);
                matchLine.addTo(map);
                bounds = bounds.concat(matchLL);
                
                // Start/end markers
                var start = L.circleMarker(matchLL[0], {radius: 10, color: '#fff', weight: 2, fillColor: '#27ae60', fillOpacity: 1});
                start.bindPopup('<b>START</b><br>' + trip.pickup);
                routeLayers.push(start);
                start.addTo(map);
                
                var end = L.circleMarker(matchLL[matchLL.length-1], {radius: 10, color: '#fff', weight: 2, fillColor: '#9b59b6', fillOpacity: 1});
                end.bindPopup('<b>END</b>');
                routeLayers.push(end);
                end.addTo(map);
            }
            
            if (bounds.length > 0) map.fitBounds(bounds, {padding: [50, 50]});
            
            // Update stats
            document.getElementById('stats').innerHTML = 
                '<b>Trip ' + trip.id + '</b><br>' +
                'GPS Points: ' + trip.gps_count + '<br>' +
                'Matched Points: ' + trip.matched_count + '<br>' +
                'Pickup: ' + trip.pickup;
            
            // Update buttons
            document.querySelectorAll('.trip-btn').forEach((b, i) => b.classList.toggle('active', i === idx));
        }

        // Build trip buttons
        var container = document.getElementById('trips');
        trips.forEach((t, i) => {
            var btn = document.createElement('button');
            btn.className = 'trip-btn';
            btn.onclick = () => loadTrip(i);
            btn.innerHTML = 'Trip ' + t.id + ' | GPS: ' + t.gps_count + ' | Matched: ' + t.matched_count;
            container.appendChild(btn);
        });

        // Load first trip
        if (trips.length > 0) loadTrip(0);
    </script>
